import React,{useState} from "react";
import "./Quiz.css";
import Navbar from 'react-bootstrap/Navbar';
import Dropdown from "react-bootstrap/Dropdown"
import CampaignIcon from '@mui/icons-material/Campaign';
import NotificationsNoneIcon from '@mui/icons-material/NotificationsNone';
import PermIdentityIcon from '@mui/icons-material/PermIdentity';
import SettingsIcon from '@mui/icons-material/Settings';
function Quiz(props){
    var email= props.user.Email;
    var userEmail = email.substring(0, email.lastIndexOf("@"));
    userEmail = userEmail.slice(0,7);
    const [className,setClassName] = useState({
        quizNavs:"quiz-navs",
        afternavs:"after-navs",
        bell:"bell",
        search:"search"
    });
    function handleClick(){
        setClassName({
            quizNavs:"set-quiz-navs",
            afternavs:"seafter-navs",
            bell:"bell",
            search:"search"
        })
    }

    return <>
        <div className="quiz-page">
        <Navbar className="quiz-navbar" expand="lg">
        <div className='quiz-brand'>
        <h1><CampaignIcon className="speaker" fontSize="60" />Quizz</h1>
        </div>
        <Navbar.Toggle aria-controls="basic-navbar-nav" onClick={handleClick} />
        <Navbar.Collapse id="basic-navbar-nav">
        <div className={className.quizNavs}>
        <h4>Practice</h4>
        <h4>Compete</h4>
        <h4>Jobs</h4>
        <h4>Leaderboard</h4>
        <h4>Certification</h4>
        </div>
        <div  className={className.afterNavs}>
        <input type="search" name="" id={className.search} placeholder="Search" />
        <NotificationsNoneIcon  sx={{ fontSize: 30 }} className={className.bell} />
        <div className="logined-user">
            <PermIdentityIcon sx={{ fontSize: 30 }} className="account-human" />
            <h4 className="account-email">{userEmail}</h4>
            <Dropdown>
            <Dropdown.Toggle id="dropdown-basic">
            </Dropdown.Toggle>
            <Dropdown.Menu>
                <Dropdown.Item href="#/action-1">Accoutns</Dropdown.Item>
                <Dropdown.Item href="#/action-2">Submissions</Dropdown.Item>
                <Dropdown.Item href="#/action-3">Hackathons</Dropdown.Item>
            </Dropdown.Menu>
            </Dropdown>
            <SettingsIcon  className="settings-icon" />
        </div>
        </div>
        </Navbar.Collapse>      
        </Navbar>
       
        </div>
    </>
}

export default Quiz;
